vscode.html.body:
setting.json
{
  // ================
  // general settings
  // ================
  "debug.inlineValues": true,
  "debug.internalConsoleOptions": "openOnSessionStart",
  "debug.openDebug": "openOnSessionStart",
  "debug.toolBarLocation": "docked",
  "editor.acceptSuggestionOnCommitCharacter": true,
  "editor.cursorBlinking": "phase",
  "editor.defaultFormatter": "esbenp.prettier-vscode",
  "editor.dragAndDrop": false,
  "editor.find.autoFindInSelection": true,
  "editor.formatOnPaste": true,
  "editor.formatOnType": true,
  "editor.lineNumbers": "on",
  "editor.minimap.maxColumn": 40,
  "editor.minimap.showSlider": "always",
  "editor.renderControlCharacters": true,
  "editor.renderLineHighlight": "all",
  "editor.renderWhitespace": "boundary",
  "editor.showFoldingControls": "always",
  "editor.insertSpaces": true,
  "extensions.autoUpdate": false,
  "files.autoGuessEncoding": true,
  "files.defaultLanguage": "javascript",
  "files.eol": "\n",
  "files.hotExit": "onExitAndWindowClose",
  "files.insertFinalNewline": true,
  "files.trimFinalNewlines": true,
  // "files.trimTrailingWhitespace": true,
  "terminal.integrated.cursorBlinking": true,
  "terminal.integrated.cursorStyle": "line",
  "terminal.integrated.enableBell": true,
  "terminal.integrated.shell.windows": "C:\\Program Files\\Git\\bin\\bash.exe",
  "window.newWindowDimensions": "inherit",
  "window.restoreFullscreen": true,
  "window.zoomLevel": 0,
  // "workbench.editor.tabCloseButton": "left",
  "workbench.iconTheme": "material-icon-theme",
  "workbench.startupEditor": "none",
  // ===========================
  // language specified settings
  // ===========================
  "[git-commit]": {
    "editor.rulers": [
      100,
    ],
  },
  "[html]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[css]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[scss]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[javascript]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[javascriptreact]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[json]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[markdown]": {
    "editor.wordWrap": "off",
    "files.trimTrailingWhitespace": false,
  },
  "[typescript]": {
    "editor.tabSize": 2,
    "editor.formatOnSave": true,
    "editor.defaultFormatter": "esbenp.prettier-vscode",
  },
  "[typescriptreact]": {
    "editor.tabSize": 2,
  },
  // ===================
  // extensions settings
  // ===================
  "typescript.extension.sortImports.maxNamedUmportsInSingleLine": 100,
  "typescript.extension.sortImports.sortMethd": "path",
  "typescript.extension.sortImports.pathSortOrder": [
    "package",
    "relativeUpLevel",
    "relativeDownLevel",
  ],
  "gitlens.advanced.messages": {
    "suppressShowKeyBindingsNotice": true
  },
  "brancketPairColorizer.consecutivePairColors": [
    "()",
    "[]",
    "{}",
    [
      "#c40",
      "#f69",
      "#39d",
      "#3b3",
      "#c6f",
      "#f0f"
    ],
    "red"
  ],
  // "javascript.preferences.quoteStyle": "single",
  // "typescript.preferences.quoteStyle": "single",
  // "vsicons.projectDetection.autoReload": true,
}
